import React from "react";

const Sidebar = () => {
  const place = document.querySelector("sidebar");
  const toolbarItems = ["Home", "about", "contacts", "login", "register"];
  function creater() {
    toolbarItems.map((x) => {
      place.innerHTML += `<div>${x}</div>`;
    });
  }

  return (
    <div className="sidebar">
      {creater()}
      {/* <div>{toolbarItems[0]}</div>
      <div>{toolbarItems[1]}</div>
      <div>{toolbarItems[2]}</div>
      <div>{toolbarItems[3]}</div>
      <div>{toolbarItems[4]}</div> */}
    </div>
  );
};

export default Sidebar;
